(68, 0, 'About Parks', '', '<p>The Parks sample site is designed as a simple site that can be routinely updated from the front end of Joomla!.</p>\r\n<p>As a site, it is largely focused on a blog which can be updated using the front end article submission.</p>\r\n<p>New weblinks can also be added through the front end.</p>\r\n<p>A simple image gallery uses com_content with thumbnails displayed in a blog layout and full size images shown in article layout.</p>', 2, 'position-2', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static","module_tag":"div","bootstrap_size":"0","header_tag":"h3","header_class":"","style":"Protostar-well"}', 0, '*'),
